import { IoSearch } from "react-icons/io5";

const SearchBar = () => {
  return (
    <div className="w-full py-2.5 flex justify-center h-full mx-auto">
      <div className="max-w-[1240px]">
        <div className="flex flex-col lg:flex-row items-center lg:pr-80 pl-5 lg:pl-0 py-4 rounded-lg border-2 border-black lg:gap-4">
          <IoSearch className="mb-4 lg:mb-0" />
          <form className="flex-grow">Search jobs</form>
        </div>
      </div>
    </div>
  );
};

export default SearchBar;
